üí°Algunas estrategias de arbitraje son:

‚Ä¢ Arbitraje simple: Comprando y vendiendo la misma moneda inmediatamente en bolsas separadas.

‚Ä¢ Arbitraje triangular: Implica aprovechar las diferencias de precio entre tres monedas. Por ejemplo,comprar BTC en USD,  venderlo para ganar EUR y luego cambiar esos EUR a USD.

